/**
 * Different types of ValueStates.
 *
 * @public
 */
enum ValueState {
	/**
	 * @public
	 */
	None = "None",

	/**
	 * @public
	 */
	Positive = "Positive",

	/**
	 * @public
	 */
	Critical = "Critical",

	/**
	 * @public
	 */
	Negative = "Negative",

	/**
	 * @public
	 */
	Information = "Information",
}

export default ValueState;
